pragma solidity >=0.6.0;
// SPDX-License-Identifier: UNLICENSED
pragma experimental ABIEncoderV2;
import '../External/Uniswap.sol';
import "../External/IERC20.sol";
import "../Execution/TriArbNoRD.sol";

contract OptimizerTrade {
	address UniswapFactoryAddress; //For converting to std
	address payable public owner;
	address payable execContract;
	bytes16 NEG_1;

	struct SimpleCall {
		address outerToken;
		address innerToken;
		address exchange1;
		address exchange2;
		uint256 swapFee1;
		uint256 swapFee2;
	}

	struct TriCall {
		address token1;
		address token2;
		address token3;
		address exchange1;
		address exchange2;
		address exchange3;
		uint256 mpMultiplier;
	}

	struct Opportunity {
		address outerToken;
		address innerToken;
		address awayPool;
		address returnPool;
		uint256 inputWei;
		uint256 innerWei;
		uint256 outputWei;
		uint256 diff;
	}

	struct TriOpportunity {
		address token1;
		address token2;
		address token3;
		address pool1;
		address pool2;
		address pool3;
		uint256 input1;
		uint256 output1; // == input2
		uint256 output2; // == input 3
		uint256 output3;
		uint256 diff;
	}

	struct OptimalInfo {
		address tokenIn;
		address tokenOut;
		uint256 input;
		uint256 output;
		uint256 reserveIn;
		uint256 reserveOut;
		address poolAddress;
		address factory;
	}

	event simpleOppEvent(
		address token1,
		address token2,
		uint256 inputWei,
		uint256 innerWei,
		uint256 outputWei,
		uint256 diff
		);

	event triOppEvent(
		address token1,
		address token2,
		address token3,
		uint256 input1,
		uint256 output1, // == input2
		uint256 output2, // == input 3
		uint256 output3,
		uint256 diff
	);

	event ErrorHandled(string reason);

	//Create modifier to limit who can call the contract
	modifier onlyOwner() {
		require(msg.sender == owner, 'Sender not authorized.');
		// Do not forget the "_;"! It will
		// be replaced by the actual function
		// body when the modifier is used.
		_;
	}

	constructor(address uniswapFactory, address payable exec) payable {
		execContract = exec;
		UniswapFactoryAddress = uniswapFactory;
		owner = payable(msg.sender);
		NEG_1 = ABDKFloat.sub(ABDKFloat.fromUInt(0), ABDKFloat.fromUInt(1));
	}

    //Withdraws any ethereum from the address
    function withdrawEth() public onlyOwner {
        owner.transfer(address(this).balance);
    }

    //Withdraw a specific ERC20 token
    function withdrawErc20(address token) external onlyOwner {
        IERC20 newToken = IERC20(token);
        newToken.transfer(owner, newToken.balanceOf(address(this)));
    }

    //Change the contract owner
    function changeOwner(address payable newOwner) external onlyOwner {
        owner = newOwner;
    }

	//Change the router address
	function changeUniswapFactory(address newAddress) external onlyOwner {
		UniswapFactoryAddress = newAddress;
	}

	function simpleMulticall(bytes[] calldata calls) external{
		for (uint i = 0; i < calls.length; i++) {
			getOpportunityFromCall(calls[i]);
		}
  	}

	// function triMulticall(bytes[] calldata calls) external{
	// 	for (uint i = 0; i < calls.length; i++) {
	// 		getTriOpportunityFromCall(calls[i]);
	// 	}
  // }

	function getOpportunityFromCall(
		bytes memory call
	) internal{
		SimpleCall memory params = abi.decode(call, (SimpleCall));
		Opportunity memory opp = getOpportunity(params);
		if(opp.diff > 0){
			emit simpleOppEvent(opp.outerToken, opp.innerToken, opp.inputWei, opp.innerWei, opp.outputWei, opp.diff);
			try TriArbNoRD(execContract).initiateTrade(abi.encode(opp.outerToken, opp.innerToken, opp.innerToken, opp.awayPool, opp.returnPool, opp.returnPool, opp.inputWei, opp.innerWei, opp.outputWei, 0)){}
			catch Error(string memory reason){
				emit ErrorHandled(reason);
			}catch{
				emit ErrorHandled('Caught with no error');
			}
		}
		delete opp;
		delete params;
	}

	// function getTriOpportunityFromCall(
	// 	bytes memory call
	// ) internal{
	// 	TriCall memory params = abi.decode(call, (TriCall));
	// 	TriOpportunity memory opp = getTriOpportunity(params);
	// 	if(opp.diff > 0){
	// 		emit triOppEvent(opp.token1, opp.token2, opp.token3, opp.input1, opp.output1, opp.output2, opp.output3, opp.diff);
	// 		try TriArbNoRD(execContract).initiateTrade(abi.encode(opp.token1, opp.token2, opp.token3, opp.pool1, opp.pool2, opp.pool3, opp.input1, opp.output1, opp.output2, opp.output3)){}
	// 		catch Error(string memory reason){
	// 			emit ErrorHandled(reason);
	// 		}catch{
	// 			emit ErrorHandled('Caught with no error');
	// 		}
	// 	}
	// 	delete opp;
	// 	delete params;
	// }

	function getOptimalInfo(OptimalInfo memory info) internal view returns (OptimalInfo memory optimalInfo) {
		//Get pool address, if it doesnt exist, return empty info which causes exit 
		info.poolAddress = IUniswapV2Factory(info.factory).getPair(info.tokenIn, info.tokenOut);
		if(info.poolAddress == address(0)){
			return info;
		}

		{
			//Get reserves for tokenIn and tokenOut and orders them correctly.
			(address tokenA, ) = sortTokens(info.tokenIn, info.tokenOut);
			(uint112 reserveA, uint112 reserveB, )  = IUniswapV2Pair(info.poolAddress).getReserves();
			(info.reserveIn, info.reserveOut) = info.tokenIn == tokenA ? (reserveA, reserveB) : (reserveB, reserveA); //Get reserve order
			delete tokenA;
			delete reserveA;
			delete reserveB;
		}

		// //If either reserve is 0 then we should exit, no opp is possible on this route
		// if(info.reserveIn <= 0 || info.reserveOut <= 0 ){
		// 	return info;
		// }

		return info;
	}

	function getAvgMP(
		uint256 reserve1A, 
		uint256 reserve1B,
		uint256 reserve2A,
		uint256 reserve2B
	) internal view returns (bytes16) {
		bytes16 rA = ABDKFloat.fromUInt(reserve1A + reserve2A);
		bytes16 rB = ABDKFloat.fromUInt(reserve1B + reserve2B);
		return ABDKFloat.div(rA, rB);
	}

	function solveQuadratic(
		bytes16 a, bytes16 b, bytes16 c
	) internal view returns (bytes16) {
		// returns ((-b + sqrt(b^2 - 4ac)) / 2a)
		bytes16 numerator = ABDKFloat.sub(ABDKFloat.sqrt(ABDKFloat.sub(ABDKFloat.mul(b, b), ABDKFloat.mul(ABDKFloat.fromUInt(4), ABDKFloat.mul(a, c)))), b);
		return ABDKFloat.div(numerator, ABDKFloat.mul(ABDKFloat.fromUInt(2), a));
	}

	function outputForTargetMP(
		uint256 Rin, 
		uint256 Rout,
		bytes16 targetMP, 
		bytes16 swapFee
	) internal view returns (uint256) {
		bytes16 a = ABDKFloat.mul(ABDKFloat.mul(swapFee, targetMP), NEG_1);
		bytes16 RoutAsBytes = ABDKFloat.fromUInt(Rout);
		bytes16 RoutByTargetMP = ABDKFloat.mul(RoutAsBytes, targetMP);
		bytes16 b1 = ABDKFloat.mul(ABDKFloat.fromUInt(2), ABDKFloat.mul(swapFee, RoutByTargetMP));
		bytes16 RinAsBytes = ABDKFloat.fromUInt(Rin);
		bytes16 b = ABDKFloat.add(RinAsBytes, ABDKFloat.sub(b1, ABDKFloat.mul(swapFee, RinAsBytes)));
		bytes16 c1 = ABDKFloat.sub(RinAsBytes, RoutByTargetMP);
		bytes16 c = ABDKFloat.mul(swapFee, ABDKFloat.mul(RoutAsBytes, c1));
		bytes16 sol = solveQuadratic(a, b, c);
		return ABDKFloat.sign(sol) == 1 ? ABDKFloat.toUInt(sol) : 0;
	}

	function getImbalance(
		uint256 reserve1A, 
		uint256 reserve1B,
		uint256 reserve2A,
		uint256 reserve2B
	) internal pure returns (bytes16) {
		bytes16 r1a = ABDKFloat.fromUInt(reserve1A);
		bytes16 r1b = ABDKFloat.fromUInt(reserve1B);
		bytes16 r2a = ABDKFloat.fromUInt(reserve2A);
		bytes16 r2b = ABDKFloat.fromUInt(reserve2B);
		bytes16 numerator = ABDKFloat.mul(r2a, r1b);
		bytes16 denom = ABDKFloat.mul(r2b, r1a);
		return ABDKFloat.sub(ABDKFloat.div(numerator, denom), ABDKFloat.fromUInt(1));
	}

	function getInputMultiplier(
		bytes16 imbalance,
		bytes16 swapFee1,
		bytes16 swapFee2
	) internal pure returns (bytes16) {
		bytes16 one = ABDKFloat.fromUInt(1);
		bytes16 sfMinus1 = ABDKFloat.sub(one, swapFee1);
		bytes16 sfMinus2 = ABDKFloat.sub(one, swapFee2);
		bytes16 numerator = ABDKFloat.sub(one, ABDKFloat.add(sfMinus1, sfMinus2));
		return ABDKFloat.div(numerator, imbalance);
	}

	function getOpportunity(
		SimpleCall memory params
		//uint256 portion
	) internal view returns (Opportunity memory) {
		OptimalInfo memory awayInfo = OptimalInfo(
			params.outerToken, // tokenIn
			params.innerToken, // tokenOut
			0, // input
			0, // output
			0, // reserveIn 
			0, // reserveOut
			address(0), // poolAddress
			IUniswapV2Router02(params.exchange1).factory()
		);
		OptimalInfo memory returnInfo = OptimalInfo(
			params.innerToken, // tokenIn
			params.outerToken, // tokenOut
			0, // optimalInput
			0, // optimalOutput
			0, // reserveIn 
			0, // reserveOut
			address(0), // poolAddress
			IUniswapV2Router02(params.exchange2).factory()
		);
		awayInfo = getOptimalInfo(awayInfo);
		returnInfo = getOptimalInfo(returnInfo);

		if(awayInfo.reserveIn <= 0 || awayInfo.reserveOut <= 0 || returnInfo.reserveIn <= 0 || returnInfo.reserveOut <= 0){
			return Opportunity(
				awayInfo.tokenIn, 
				awayInfo.tokenOut, 
				awayInfo.poolAddress,
				returnInfo.poolAddress,
				awayInfo.input,
				awayInfo.output,
				returnInfo.output,
				0
			);
		}

		bytes16 imbalance = getImbalance(
			awayInfo.reserveIn,
			awayInfo.reserveOut,
			returnInfo.reserveOut,
			returnInfo.reserveIn
		);

		if (ABDKFloat.sign(imbalance) != 1) {
			return Opportunity(
				awayInfo.tokenIn, 
				awayInfo.tokenOut, 
				awayInfo.poolAddress,
				returnInfo.poolAddress,
				awayInfo.input,
				awayInfo.output,
				returnInfo.output,
				0
			);
		}

		if (awayInfo.reserveIn <= returnInfo.reserveOut) {
			bytes16 targetMP = getAvgMP(
				awayInfo.reserveIn,
				awayInfo.reserveOut,
				returnInfo.reserveOut,
				returnInfo.reserveIn
			); 

			awayInfo.output = outputForTargetMP(
				awayInfo.reserveIn, 
				awayInfo.reserveOut,
				targetMP,
				ABDKFloat.div(ABDKFloat.fromUInt(params.swapFee1), ABDKFloat.fromUInt(1000))
			);

			if (awayInfo.output > 0) {
				awayInfo.input = IUniswapV2Router02(params.exchange1).getAmountIn(awayInfo.output, awayInfo.reserveIn, awayInfo.reserveOut);
			} else {
				return Opportunity(
					awayInfo.tokenIn, 
					awayInfo.tokenOut, 
					awayInfo.poolAddress,
					returnInfo.poolAddress, 
					awayInfo.input, 
					awayInfo.output, 
					returnInfo.output, 
					0
				);
			}
		} else {
			bytes16 targetMP = getAvgMP(
				awayInfo.reserveOut,
				awayInfo.reserveIn,
				returnInfo.reserveIn,
				returnInfo.reserveOut
			);

			returnInfo.output = outputForTargetMP(
				returnInfo.reserveIn,
				returnInfo.reserveOut,
				ABDKFloat.div(ABDKFloat.fromUInt(1), targetMP),
				ABDKFloat.div(ABDKFloat.fromUInt(params.swapFee2), ABDKFloat.fromUInt(1000))
			);

			if (returnInfo.output > 0) {
				returnInfo.input = IUniswapV2Router02(params.exchange2).getAmountIn(returnInfo.output, returnInfo.reserveIn, returnInfo.reserveOut);
				awayInfo.input = IUniswapV2Router02(params.exchange1).getAmountIn(returnInfo.input, awayInfo.reserveIn, awayInfo.reserveOut);
			} else {
				return Opportunity(
					awayInfo.tokenIn, 
					awayInfo.tokenOut, 
					awayInfo.poolAddress,
					returnInfo.poolAddress,
					awayInfo.input,
					awayInfo.output,
					returnInfo.output,
					0
				);
			}
		}
		awayInfo.input = ABDKFloat.toUInt(ABDKFloat.mul(getInputMultiplier(
			imbalance, 
			ABDKFloat.div(ABDKFloat.fromUInt(params.swapFee1), ABDKFloat.fromUInt(1000)), 
			ABDKFloat.div(ABDKFloat.fromUInt(params.swapFee2), ABDKFloat.fromUInt(1000))
		), ABDKFloat.fromUInt(awayInfo.input)));
		awayInfo.output = IUniswapV2Router02(params.exchange1).getAmountOut(awayInfo.input, awayInfo.reserveIn, awayInfo.reserveOut);
		returnInfo.output = IUniswapV2Router02(params.exchange2).getAmountOut(awayInfo.output, returnInfo.reserveIn, returnInfo.reserveOut);
		return Opportunity(
			awayInfo.tokenIn, 
			awayInfo.tokenOut, 
			awayInfo.poolAddress,
			returnInfo.poolAddress,
			awayInfo.input,
			awayInfo.output,
			returnInfo.output, 
			returnInfo.output > awayInfo.input ? returnInfo.output - awayInfo.input : 0
		);
	}

